export const HotelImages = ({ singleHotel }) => {
  console.log(singleHotel);
  const { image, imageArr } = singleHotel;

  return (
    <div className="flex flex-col md:flex-row gap-2 md:gap-4 h-[25rem]">
      <div className="flex-shrink-0 h-full">
        <img
          className="w-full h-full object-cover"
          src={image}
          alt="hotel"
        />
      </div>
      <div className="flex flex-wrap gap-2">
        {imageArr &&
          imageArr.map((img, index) => (
            <img
              key={index} // Using index as key as image URL might not be unique
              className="w-[20vw] h-[50%] md:w-32 md:h-24 object-cover"
              src={img}
              alt="hotel"
            />
          ))}
      </div>
    </div>
  );
};
